import React from 'react';
import HomePage from './pages/homepage.component';
import { Route } from 'react-router-dom';
import './App.css';

const HatsPage = () => (
  <h1>HatsPage</h1>
)

function App() {
  return (
    <div>
      <Route exact path="/" component={<HomePage />} />
      <Route path="/hats-page" component={<HatsPage />} />
    </div>
  );
}

export default App;
